css:
.editor-colors {
  background-color: #fdf6e3;
  color: #657b83;
}
.editor .invisible-character {
  color: #cad0d0;
}
.editor .indent-guide {
  color: #cad0d0;
}
.editor .gutter {
  background-color: #eee8d5;
  color: #657b83;
}
.editor .gutter .line-number {
  opacity: 1;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #d33682;
}
.editor .cursor {
  border-color: #002b36;
}
.editor .selection .region {
  background-color: #eee8d5;
}
.editor .line-number.cursor-line {
  background-color: #e7dec3;
}
.bracket-matcher {
  background-color: #93a1a1;
  opacity: 0.5;
}
.comment {
  color: #93a1a1;
  font-style: italic;
}
.entity {
  color: #b58900;
}
.keyword {
  color: #859900;
}
.storage.type {
  color: #859900;
}
.constant {
  color: #b58900;
}
.constant.numeric,
.constant.boolean {
  color: #2aa198;
}
.variable {
  color: #268bd2;
}
.delimiter,
.brace {
  color: #dc322f;
}
.delimiter.period {
  color: #859900;
}
.invalid.deprecated {
  text-decoration: underline;
  color: #dc322f;
}
.invalid.illegal {
  color: #dc322f;
}
.string {
  color: #2aa198;
}
.string .constant.character.escape {
  color: #dc322f;
}
.string.regexp {
  color: #2aa198;
}
.string.regexp .source.ruby.embedded,
.string.regexp .string.regexp.arbitrary-repitition {
  color: #dc322f;
}
.editor .gfm .markup.italic {
  font-style: italic;
}
.editor .gfm .markup.bold {
  font-weight: bold;
}
.editor .gfm .markup.heading {
  color: #cb4b16;
}
.editor .gfm .link {
  color: #2aa198;
}
.editor .gfm .link .entity {
  color: #6c71c4;
}
.editor .gfm .raw {
  font-style: italic;
}
.editor .gfm.support {
  color: #dc322f;
}
.terminal {
  background-color: #fdf6e3;
}
.terminal .color-0 {
  color: #657b83;
}
.terminal .background-0 {
  background-color: #fdf6e3;
}
.terminal .color-1 {
  color: #dc322f;
}
.terminal .background-1 {
  background-color: #dc322f;
}
.terminal .color-2 {
  color: #859900;
}
.terminal .background-2 {
  background-color: #859900;
}
.terminal .color-3 {
  color: #b58900;
}
.terminal .background-3 {
  background-color: #b58900;
}
.terminal .color-4 {
  color: #268bd2;
}
.terminal .background-4 {
  background-color: #268bd2;
}
.terminal .color-5 {
  color: #d33682;
}
.terminal .background-5 {
  background-color: #d33682;
}
.terminal .color-6 {
  color: #2aa198;
}
.terminal .background-6 {
  background-color: #2aa198;
}
.terminal .color-7 {
  color: #002b36;
}
.terminal .background-7 {
  background-color: #002b36;
}
.editor .gutter .git-line-modified {
  border-left: 2px solid #b58900;
  padding-left: calc(0.5em - 2px);
  color: #657b83;
}
.editor .gutter .git-line-added {
  border-left: 2px solid #859900;
  padding-left: calc(0.5em - 2px);
  color: #657b83;
}
.editor .gutter .git-line-removed {
  border-left: 2px solid #dc322f;
  padding-left: calc(0.5em - 2px);
  color: #657b83;
}
.editor .wrap-guide {
  background-color: #cad0d0;
}
.editor .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #93a1a1;
}
.editor .search-results .marker.current-result .region {
  border: 1px solid #002b36;
}
